import React from "react";
import "./NavBar.css";
import { NavLink } from "react-router-dom";
import { useIsAuthenticated, useAuthUser } from "react-auth-kit";

const NavigationBar = () => {
  const authUser = useAuthUser();
  const isAuthenticated = useIsAuthenticated();
  return (
    <div className="navbar">
      <ul className="side left-side">
        <NavLink
          id="news"
          to="/"
          className={({ isActive }) => (isActive ? "active" : undefined)}
          end
        >
          News
        </NavLink>
        {!isAuthenticated() && (
          <NavLink
            to="/login"
            className={({ isActive }) => (isActive ? "active" : undefined)}
          >
            School
          </NavLink>
        )}
        {!isAuthenticated() && (
          <NavLink
            to="register"
            className={({ isActive }) => (isActive ? "active" : undefined)}
          >
            Work
          </NavLink>
        )}
        {!isAuthenticated() && (
          <NavLink
            to="contact"
            className={({ isActive }) => (isActive ? "active" : undefined)}
          >
            Home
          </NavLink>
        )}

        {!isAuthenticated() && (
          <NavLink
            to="about"
            className={({ isActive }) => (isActive ? "active" : undefined)}
          >
            Study
          </NavLink>
        )}

        {isAuthenticated() && (
          <NavLink
            to="presentation"
            className={({ isActive }) => (isActive ? "active" : undefined)}
          >
            Academy
          </NavLink>
        )}

        {isAuthenticated() && (
          <NavLink
            to="activePresentations"
            className={({ isActive }) => (isActive ? "active" : undefined)}
          >
            MarketPlace
          </NavLink>
        )}
      </ul>

      <ul className="side right-side">
        {isAuthenticated() && (
          <NavLink
            id="contact-sales"
            to="joinALecture"
            className={({ isActive }) => (isActive ? "active" : undefined)}
          >
            Contact Sales
          </NavLink>
        )}

        {isAuthenticated() && (
          <NavLink
            to="signOut"
            className={({ isActive }) => (isActive ? "active" : undefined)}
          >
            Explore Content
          </NavLink>
        )}

        <li>
          <NavLink
            to="signOut"
            className={({ isActive }) => (isActive ? "active" : undefined)}
          >
            Play
          </NavLink>
        </li>

        <li>
          <NavLink
            id="sign-up"
            to="signOut"
            className={({ isActive }) => (isActive ? "active" : undefined)}
          >
            Sign Up
          </NavLink>
        </li>

        <li>
          <NavLink
            to="signOut"
            className={({ isActive }) => (isActive ? "active" : undefined)}
          >
            Log in
          </NavLink>
        </li>
      </ul>
      {isAuthenticated() && (
        <div className="user-greeting">Hello {authUser().firstName}</div>
      )}
    </div>
  );
};

export default NavigationBar;
